import React from 'react';
import { 
  SafeAreaView,
  View,
  Text,
  TouchableOpacity,
  StyleSheet
} from 'react-native';

const LandingScreen = ({ navigation }) => {

  return (
    <SafeAreaView style={styles.container}>
      <View style={styles.view1}>
        <Text style={styles.titleText}> Music Player </Text>
      </View>
      <View style={styles.view2}>
        <View style={styles.touchablesWrapper}>
          <TouchableOpacity
            activeOpacity={0.7}
            onPress={() => navigation.navigate('tracks')}
          >
            <View style={styles.button}>
              <Text style={styles.buttonText}> Tracks </Text>
            </View>
          </TouchableOpacity>
          <TouchableOpacity
            activeOpacity={0.7}
            onPress={() => navigation.navigate('favorites')}
          >
            <View style={styles.button}>
              <Text style={styles.buttonText}> Favorites </Text>
            </View>
          </TouchableOpacity>
          <TouchableOpacity
            activeOpacity={0.7}
            onPress={() => navigation.navigate('playlists')}
          >
            <View style={styles.button}>
              <Text style={styles.buttonText}> Playlists </Text>
            </View>
          </TouchableOpacity>
        </View>
      </View>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column",
    backgroundColor: '#f1f2ff'
  },
  view1: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
    marginTop: 30
  },
  titleText: {
    fontSize: 45,
    fontWeight: '700',
    fontFamily: 'Roboto',
    color: 'black'
  },
  view2: {
    flex: 5,
    alignItems: "center",
    justifyContent: "flex-start"
  },
  touchablesWrapper: {
    alignItems: "center",
    justifyContent: "center",
    marginTop: 170
  },
  button: {
    width: 180,
    height: 60,
    borderRadius: 30,
    borderColor: '#3d54dc',
    backgroundColor: "#3d54dc",
    borderWidth: 3,
    alignItems: "center",
    justifyContent: "center",
    margin: 15
  },
  buttonText: {
    color: "white",
    fontSize: 25,
    fontWeight: '400',
    fontFamily: 'Roboto'
  }
});

export default LandingScreen;
